const _ = require('lodash');
// \u8FD0\u884C\u8FD9\u4E2A\u811A\u672C\u4E4B\u524D\uFF0C\u628A\u8FD9\u4E2A\u53C2\u6570\u6539\u6210\u672C\u5730fusion\u4ED3\u5E93\u7684docs\u76EE\u5F55
const fusionDocs = 'fusionDocs';
